import React, {useState} from "react";
import "./Home.css";
import Card from "../components/Card";

function Home(){

    const [test, setTest] = useState([{
        title: "Jee Advance",
        description: "App provides simple mathematical functions in a beautifully designed interface." +
            "It performs basic calculations such as addition, subtraction, multiplication, and division.",
        url: "../images/jee.webp"
    },{
        title: "GATE Test",
        description: "App provides simple mathematical functions in a beautifully designed interface." +
            "It performs basic calculations such as addition, subtraction, multiplication, and division.",
        url: "../images/gate.png"
    },{
        title: "CAT Test",
        description: "App provides simple mathematical functions in a beautifully designed interface." +
            "It performs basic calculations such as addition, subtraction, multiplication, and division.",
        url:"../images/cat.jpeg"
    }
    ]);

    return (

        <div className="home">
            <img className="home__image"
                 src={require("../images/banner.jpg")}
                 alt="" />

            <div className="home__row">
                {
                    test.map((info, i) =>{
                       return(
                           <Card src={require("../images/jee.webp")}
                                 description={info.description}
                                 title={info.title}
                                 id={i}
                           />
                       )
                    })
                }
            </div>

        </div>

    );
}

export default Home;
